import React from 'react'
import { Box, Button, Typography } from '@mui/material'

const QuestionButton = ({text, onClick}) => {
    return (
        <Paper sx={{ borderRadius: "25px" }} elevation={5}>
            <Button
                sx={{ 
                    minWidth: '400px',
                    minHeight: '400px'
                }}
                variant="text"
                onClick={onClick}
            >
                <Typography variant="h6">
                    {text}
                </Typography>
            </Button>

        </Paper>
    )
}

export default QuestionButton
